import React from 'react';
import axios from 'axios';



export default class Scrape extends React.Component {

    state={imgVdData:[null]};

    async componentDidMount() {

        let response = await axios.get(`http://localhost:3000/readScraped`,{headers: {'Authorization': `Basic dGVzdDp0ZXN0MTIz`}});

        console.log("RESPONSE++++++++++++++++++++++++++++++++");
        console.log(response.data);
        console.log(response.data);
        this.setState({ imgVdData:response.data });
    }

    render() {
      return (
        <ul>
          { this.state.imgVdData.map(data => <li>{data}</li>)}
        </ul>
      )
    }
  }
